import React from 'react';
import './ModelsCard.css';

const ModelsCard = ({ model }) => {
  return (
    <div className="card">
      <h3>{model.name}</h3>
      <p>SKU: {model.sku}</p>
      <p>Descripción: {model.description}</p>
      <p><a href={model.detailUrl} target="_blank" rel="noopener noreferrer">Más detalles</a></p>
      {model.additionalAttribute && <p>{model.additionalAttribute.name}: {model.additionalAttribute.value}</p>}
    </div>
  );
};

export default ModelsCard;
